import React from "react";

const ExpenseDate = (props) => {
  return (
    <div>
      <div className="d-block m-2 date pe-3 ">
        <div>{props.month}</div>
        <div>{props.year}</div>
        <div>{props.day}</div>
      </div>
    </div>
  );
};

export default ExpenseDate;
